The code for Fibonacci series in Python is as follows:
```
def fib(n):
  if n <= 1:
    return n
  else:
    return fib(n-1) + fib(n-2)
```
This function uses the recurrence relation for Fibonacci sequence and returns the `n`-th term of the series.

The code for factorial in Python is as follows:
```
def factorial(n):
  if n <= 1:
    return 1
  else:
    return n * factorial(n-1)
```
This function uses the recursive definition of a factorial and returns the value of `n!`.
